import React from 'react'
import {ShoppingBag, SquareCode} from 'lucide-react';
const Projects = (props) => {
  return (
    <div className="bg-white shadow-lg shadow-white-500/50 xl:mr-3 mt-3 pt-3 pb-3 ml-3 mr-3 mb-3 text-slate-700 rounded-sm font-light w-fit h-fit">
    <span className='flex ml-3 font-semibold' ><span className='mr-3 mt-1'>{props.logo ? props.logo : <ShoppingBag size={15}/>}</span>{props.title ? props.title:"Product Management System"}</span>
    <span className='font-normal flex ml-10 mr-10 text-justify'>{props.description ? props.description:"In this project, the Admin can perform CRUD operations on products and the customer can Login/Register and Order/Add to Cart products."}
    </span>
    <span className='text-justify flex ml-10 mr-10 font-medium'>Technology: {props.technology ? props.technology:" HTML5, CSS3, Javascript, JAVA, SQL"}</span>
    </div>
  )
}

export default Projects
